		public static byte[] readFully(InputStream input) throws IOException{
	        byte[] buffer = new byte[8192];
	        int bytesRead;
	        ByteArrayOutputStream output = new ByteArrayOutputStream();
	        while ((bytesRead = input.read(buffer)) != -1)
	        {
	            output.write(buffer, 0, bytesRead);
	        }
	        return output.toByteArray();
	    }
	    
	    public static void showMemory() {
	         DecimalFormat format = new DecimalFormat("###,###,###.##");
	         //JVM이 현재 시스템에 요구 가능한 최대 메모리량, 이 값을 넘으면 OutOfMemory 오류가 발생 합니다.               
	         long max = r.maxMemory() / (1024*1024);
	         //JVM이 현재 시스템에 얻어 쓴 메모리의 총량
	         long total = r.totalMemory() / (1024*1024);
	         //JVM이 현재 시스템에 청구하여 사용중인 최대 메모리(total)중에서 사용 가능한 메모리
	         long free = r.freeMemory() / (1024*1024);
	         System.out.println("knock Max:" + format.format(max) + " MB, Total:" + format.format(total) + " MB, Free:"+format.format(free) + " MB");
		 }
	    
	    public static String float2Bytes(float value){
	    	CommonConvertorImpl cci = new CommonConvertorImpl();
			byte[] array = new byte[4];
	        int intBits=Float.floatToIntBits(value);
	        array[0]=(byte)((intBits&0x000000ff)>>0);
	        array[1]=(byte)((intBits&0x0000ff00)>>8);
	        array[2]=(byte)((intBits&0x00ff0000)>>16);
	        array[3]=(byte)((intBits&0xff000000)>>24);
	        String str = cci.byteArrayToHex(array);
	        return str;
	    }
	    
